import React from 'react';
import { Navbar, Nav, NavDropdown, Container } from 'react-bootstrap';


const NavBar = () => {
    return (
    <Navbar bg="light" expand="lg">
      <Container>
        {/* Mon nom à gauche */}
        <Navbar.Brand href="#">Mon Nom</Navbar.Brand>

        {/* Menu Burger pour mobile */}
        <Navbar.Toggle aria-controls="navbarNav" />
        <Navbar.Collapse id="navbarNav">
          {/* Onglets à droite */}
          <Nav className="ms-auto">
            <Nav.Link href="#home">Accueil</Nav.Link>
            <Nav.Link href="#about">À propos</Nav.Link>
            <Nav.Link href="#services">Services</Nav.Link>
            <Nav.Link href="#contact">Contact</Nav.Link>

            {/* Exemple d'un menu déroulant */}
            <NavDropdown title="Plus" id="navbarScrollingDropdown">
              <NavDropdown.Item href="#action/3.1">Option 1</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.2">Option 2</NavDropdown.Item>
              <NavDropdown.Item href="#action/3.3">Option 3</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavBar;
